def dumpxml(out, obj, mode=None):
    if obj is None:
        out.write('<null />')
        return
    if isinstance(obj, dict):
        out.write('<dict size="%d">\n' % len(obj))
        for (k,v) in obj.items():
            out.write('<key>%s</key>\n' % k)
            out.write('<value>')
            dumpxml(out, v)

